import { Hexagon, Text } from 'react-hexgrid'

const Cell = ({ q, r, i }) => {

    const cellStyle = {
        // Customize the cell's appearance based on the value of i
        position: 'relative',
        width: '100%',
        height: '100%',
        backgroundColor: 'blue',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      };


    return (
        <Hexagon key={i} q={q} r={r} style={cellStyle}>
            <Text>
                {i}
            </Text>
        </Hexagon>
    )
}
export default Cell;
